// This code will prevent unexpected menu close when using some components (like accordion, forms, etc)
jQuery(document).on('click', '.yamm .dropdown-menu, .dnsw-mega-menu-deluxe .tabbable', function (e) {
  e.stopPropagation();
});

// add class to HTML if screen is 768 or higher
(function($) {
  var $window = $(window),
    $html = $('html');
  function resize() {
    if ($window.width() > 767) {
      return $html.addClass('no-mobile');
    }
    $html.removeClass('no-mobile');
  }
  $window
    .resize(resize)
    .trigger('resize');
  setInterval(function(){
    $('.no-mobile .dnsw-mega-menu-deluxe .yamm-fw.active').removeClass('active');//remove class active
  },1000);
})(jQuery);
jQuery('.dropdown-toggle').on('click', function(){
  jQuery('.nav-pills li, .tab-pane').removeClass('active');
  jQuery('#highlights-menu.tab-pane').addClass('active');
});
// lazy load megamenu images
jQuery(document).on('click', '.no-mobile .dropdown-toggle', function (e) {
  jQuery('.dropdown-menu img').each(function(index, img){
    if (typeof img.dataset.src !== 'undefined') {
      img.setAttribute('src', img.dataset.src);
    }
  });
});
;
